    def detect_ifvg(data, imbalance_threshold=0.002):
        """
        Detects iFVG (Imbalance Fair Value Gaps) by comparing price imbalances.
        Returns True if an iFVG signal is detected, otherwise returns False.
        
        Parameters:
        - data: The DataFrame containing the stock data with columns ['Datetime', 'Open', 'High', 'Low', 'Close', 'Adj Close', 'Volume']
        - imbalance_threshold: Defines how much of an imbalance is needed between candles.
        
        Returns:
        - bool: True if an iFVG is detected, False otherwise.
        """
        #print('detecting')
        for i in range(2, len(data)):
            current_high = data['High'].iloc[i]
            previous_low = data['Low'].iloc[i - 2]
            
            # Identify imbalances where there's a significant difference between the high of one candle
            # and the low of a previous candle, indicating a potential reversal zone
            imbalance = (current_high - previous_low) / previous_low
            #print(imbalance)
            if imbalance >= imbalance_threshold:
                return True
        
        return False
